		case IsSendCall:
			print("IsSendCall");
			break;
		case IsSuperSend:
			print("IsSuperSend");
			break;
		case IsDirectedSuperSend:
			print("IsDirectedSuperSend");
			break;
		case IsNSSelfSend:
			print("IsNSSelfSend");
			break;
		case IsNSDynamicSuperSend:
			print("IsNSDynamicSuperSend");
			break;
		case IsNSImplicitReceiverSend:
			print("IsNSImplicitReceiverSend");
