	assert(methodOrBlockNumArgs <= (numRegArgs()));
	/* begin RetN: */
	genoperand(RetN, 0);

	jmpTarget(jumpCond, genMoveConstantR(trueObject(), ReceiverResultReg));
	assert(methodOrBlockNumArgs <= (numRegArgs()));
	/* begin RetN: */
	genoperand(RetN, 0);

	jmpTarget(jumpNonInt, jmpTarget(jumpFail, genoperandoperand(Label, (labelCounter += 1), bytecodePC)));


